import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="container">
        <div class="card text-center">
          <img class="card-img-top" src="" alt="" />
          <div class="card-body">
            <h4 class="card-title">Title</h4>
            <p class="card-text">Body</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
